SET default_table_access_method = heap;

--
-- Name: action_taken; Type: TABLE; Schema: complaint; Owner: -
--

CREATE TABLE complaint.action_taken (
    action_taken_guid uuid DEFAULT public.uuid_generate_v4() NOT NULL,
    complaint_identifier character varying(20),
    complaint_update_guid uuid,
    action_details_txt text,
    logged_by_txt character varying(250),
    action_utc_timestamp timestamp without time zone,
    create_user_id character varying(32) NOT NULL,
    create_utc_timestamp timestamp without time zone NOT NULL,
    update_user_id character varying(32) NOT NULL,
    update_utc_timestamp timestamp without time zone NOT NULL,
    CONSTRAINT action_taken_check CHECK (((complaint_identifier IS NOT NULL) OR (complaint_update_guid IS NOT NULL)))
);


--
-- Name: TABLE action_taken; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON TABLE complaint.action_taken IS 'Contains information about who the call centre staff contacted and when to allow Officers to know who to follow up with and/or if someone else is already taking action.';


--
-- Name: COLUMN action_taken.action_taken_guid; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.action_taken_guid IS 'System generated unique key for an action taken record.  This key should never be exposed to users via any system utilizing the tables.';


--
-- Name: COLUMN action_taken.complaint_identifier; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.complaint_identifier IS 'Natural key for a complaint generated by webEOC.  Format is YY-###### where the number portion of the sequence resets to 0 on the new year.  Either a complaint_update_guid or a complaint_identifier must be present on the record.';


--
-- Name: COLUMN action_taken.complaint_update_guid; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.complaint_update_guid IS 'System generated unique key for a COMPLAINT_UPDATE.  This key should never be exposed to users via any system utilizing the tables.   Either a complaint_update_guid or a complaint_identifier must be present on the record.';


--
-- Name: COLUMN action_taken.action_details_txt; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.action_details_txt IS 'Text about who the call centre staff contacted and when';


--
-- Name: COLUMN action_taken.logged_by_txt; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.logged_by_txt IS 'The name of the webEOC User that recorded the ACTION_TAKEN';


--
-- Name: COLUMN action_taken.action_utc_timestamp; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.action_utc_timestamp IS 'The date from webEOC that the ACTION_TAKEN was recorded.   The timestamp is stored in UTC with no Offset.';


--
-- Name: COLUMN action_taken.create_user_id; Type: COMMENT; Schema: complaint; Owner: -
--

COMMENT ON COLUMN complaint.action_taken.create_user_id IS 'The id of the user that created the ACTION_TAKEN';


--
-- Name: COLUMN action_taken.create_utc_timestamp; Type: COMMENT; Schema: complaint; Owner: -
--

