--
-- Name: cos_geo_org_unit_flat_mvw; Type: MATERIALIZED VIEW; Schema: complaint; Owner: -
--

CREATE MATERIALIZED VIEW complaint.cos_geo_org_unit_flat_mvw AS
 SELECT DISTINCT gou.geo_organization_unit_code AS region_code,
    gou.short_description AS region_name,
    gou2.geo_organization_unit_code AS zone_code,
    gou2.short_description AS zone_name,
    gou3.geo_organization_unit_code AS offloc_code,
    gou3.short_description AS offloc_name,
    (COALESCE(gou4.geo_organization_unit_code, NULL::character varying))::character varying(10) AS area_code,
    (COALESCE(gou4.short_description, NULL::character varying))::character varying(50) AS area_name,
    gou3.administrative_office_ind
   FROM (((((((complaint.geo_org_unit_structure gos
     JOIN complaint.geo_organization_unit_code gou ON (((gos.parent_geo_org_unit_code)::text = (gou.geo_organization_unit_code)::text)))
     JOIN complaint.geo_org_unit_structure gos2 ON (((gos2.parent_geo_org_unit_code)::text = (gou.geo_organization_unit_code)::text)))
     JOIN complaint.geo_organization_unit_code gou2 ON (((gos2.child_geo_org_unit_code)::text = (gou2.geo_organization_unit_code)::text)))
     JOIN complaint.geo_org_unit_structure gos3 ON (((gos3.parent_geo_org_unit_code)::text = (gou2.geo_organization_unit_code)::text)))
     JOIN complaint.geo_organization_unit_code gou3 ON (((gos3.child_geo_org_unit_code)::text = (gou3.geo_organization_unit_code)::text)))
     LEFT JOIN complaint.geo_org_unit_structure gos4 ON (((gos4.parent_geo_org_unit_code)::text = (gou3.geo_organization_unit_code)::text)))
     LEFT JOIN complaint.geo_organization_unit_code gou4 ON (((gos4.child_geo_org_unit_code)::text = (gou4.geo_organization_unit_code)::text)))
  WHERE (((gou.geo_org_unit_type_code)::text = 'REGION'::text) AND ((gou2.geo_org_unit_type_code)::text = 'ZONE'::text) AND ((gou3.geo_org_unit_type_code)::text = 'OFFLOC'::text) AND (((gou4.geo_org_unit_type_code)::text = 'AREA'::text) OR (gou4.geo_org_unit_type_code IS NULL)) AND ((gos.agency_code_ref)::text = 'COS'::text))
  WITH NO DATA;


